// 引入 Vue
import Vue from 'vue'
// 引入 App
import App from './App.vue'
// 引入 ElementUI 组件库
import ElementUI from 'element-ui'
// 引入 ElementUI 全部样式
import 'element-ui/lib/theme-chalk/index.css'

// 关闭 Vue 的生产提示
Vue.config.productionTip = false
// 应用 elementUI
Vue.use(ElementUI);

// 创建 vm
new Vue({
  el: '#app',
  render: h => h(App),
})
